    \   Item #1-Upon reviewing our records, it has been determined that an inadvertent
    clerical error has been made.  The $5,000 transfer was from the Democratic Executive
    Committee of Manatee County.  This name of this committee (DPCM) was used in error.
    \  The error has been corrected in this amended filing.                                                                                                          Item
